    public class func drawTextBlock(frame frame: CGRect = CGRect(x: 0, y: 0, width: 156, height: 195), arrowTintColor: UIColor = UIColor(red: 1.000, green: 0.067, blue: 0.310, alpha: 1.000), sgvText: String = "High", bg_delta: String = "+00 mg/dl", textSizeForSgv: CGFloat = 39, textSizeForDelta: CGFloat = 27) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let arrowTintHighlightColor = arrowTintColor.colorWithHighlight(0.1)
        let arrowTintShadowColorDarker = arrowTintColor.colorWithShadow(0.6)

        //// Shadow Declarations
        let dropShaddow = NSShadow()
        dropShaddow.shadowColor = arrowTintShadowColorDarker.colorWithAlphaComponent(0.7 * CGColorGetAlpha(arrowTintShadowColorDarker.CGColor))
        dropShaddow.shadowOffset = CGSize(width: 0.1, height: 0.6)
        dropShaddow.shadowBlurRadius = 1


        //// Subframes
        let group: CGRect = CGRect(x: frame.minX + floor((frame.width - 90) * 0.50000 + 0.5), y: frame.minY + floor((frame.height - 67) * 0.54687 + 0.5), width: 90, height: 67)


        //// Group
        CGContextSaveGState(context)
        CGContextSetShadowWithColor(context, dropShaddow.shadowOffset, dropShaddow.shadowBlurRadius, (dropShaddow.shadowColor as! UIColor).CGColor)
        CGContextBeginTransparencyLayer(context, nil)


        //// sgvLabel Drawing
        let sgvLabelRect = CGRect(x: group.minX, y: group.minY, width: 90, height: 54)
        let sgvLabelStyle = NSMutableParagraphStyle()
        sgvLabelStyle.alignment = .Center

        let sgvLabelFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(textSizeForSgv), NSForegroundColorAttributeName: arrowTintHighlightColor, NSParagraphStyleAttributeName: sgvLabelStyle]

        NSString(string: sgvText).drawInRect(sgvLabelRect, withAttributes: sgvLabelFontAttributes)


        //// deltaLabel Drawing
        let deltaLabelRect = CGRect(x: group.minX, y: group.minY + 46, width: 90, height: 21)
        let deltaLabelStyle = NSMutableParagraphStyle()
        deltaLabelStyle.alignment = .Center

        let deltaLabelFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(textSizeForDelta), NSForegroundColorAttributeName: arrowTintHighlightColor, NSParagraphStyleAttributeName: deltaLabelStyle]

        let deltaLabelTextHeight: CGFloat = NSString(string: bg_delta).boundingRectWithSize(CGSize(width: deltaLabelRect.width, height: CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: deltaLabelFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, deltaLabelRect)
        NSString(string: bg_delta).drawInRect(CGRect(x: deltaLabelRect.minX, y: deltaLabelRect.minY + (deltaLabelRect.height - deltaLabelTextHeight) / 2, width: deltaLabelRect.width, height: deltaLabelTextHeight), withAttributes: deltaLabelFontAttributes)
        CGContextRestoreGState(context)


        CGContextEndTransparencyLayer(context)
        CGContextRestoreGState(context)
    }

    public class func drawWatchFaceComposite(frame frame: CGRect = CGRect(x: 0, y: 0, width: 156, height: 195), arrowTintColor: UIColor = UIColor(red: 1.000, green: 0.067, blue: 0.310, alpha: 1.000), angle: CGFloat = 0, isArrowVisible: Bool = true, doubleUp: Bool = true, sgvText: String = "High", bg_delta: String = "+00 mg/dl", isUncomputable: Bool = true, computeAnimation: CGFloat = 0, textSizeForSgv: CGFloat = 39, textSizeForDelta: CGFloat = 27) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// compassControl Drawing
        let compassControlRect = CGRect(x: frame.minX + floor(frame.width * 0.00000 + 0.5), y: frame.minY + floor(frame.height * 0.00000 + 0.5), width: floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), height: floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(compassControlRect)
        CGContextTranslateCTM(context, compassControlRect.origin.x, compassControlRect.origin.y)

        NSAssetKit.drawWatchFaceOnly(frame: CGRect(x: 0, y: 0, width: compassControlRect.size.width, height: compassControlRect.size.height), arrowTintColor: arrowTintColor, angle: angle, isArrowVisible: isArrowVisible, doubleUp: doubleUp)
        CGContextRestoreGState(context)


        if (isUncomputable) {
            //// computeCircle Drawing
            let computeCircleRect = CGRect(x: frame.minX + floor(frame.width * 0.00000 + 0.5), y: frame.minY + floor(frame.height * 0.00000 + 0.5), width: floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), height: floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
            CGContextSaveGState(context)
            UIRectClip(computeCircleRect)
            CGContextTranslateCTM(context, computeCircleRect.origin.x, computeCircleRect.origin.y)

            NSAssetKit.drawUncomputedCircle(frame: CGRect(x: 0, y: 0, width: computeCircleRect.size.width, height: computeCircleRect.size.height), arrowTintColor: arrowTintColor, isUncomputable: isUncomputable, computeAnimation: computeAnimation)
            CGContextRestoreGState(context)
        }


        //// textArea Drawing
        let textAreaRect = CGRect(x: frame.minX + floor(frame.width * 0.00000 + 0.5), y: frame.minY + floor(frame.height * 0.00000 + 0.5), width: floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), height: floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(textAreaRect)
        CGContextTranslateCTM(context, textAreaRect.origin.x, textAreaRect.origin.y)

        NSAssetKit.drawTextBlock(frame: CGRect(x: 0, y: 0, width: textAreaRect.size.width, height: textAreaRect.size.height), arrowTintColor: arrowTintColor, sgvText: sgvText, bg_delta: bg_delta, textSizeForSgv: textSizeForSgv, textSizeForDelta: textSizeForDelta)
        CGContextRestoreGState(context)
    }

    public class func drawUncomputedCircle(frame frame: CGRect = CGRect(x: 0, y: 0, width: 156, height: 195), arrowTintColor: UIColor = UIColor(red: 1.000, green: 0.067, blue: 0.310, alpha: 1.000), isUncomputable: Bool = true, computeAnimation: CGFloat = 0) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let arrowTintShadowColor = arrowTintColor.colorWithShadow(0.2)
        let arrowTintShadowColorDarker = arrowTintColor.colorWithShadow(0.6)

        //// Shadow Declarations
        let dropShaddow = NSShadow()
        dropShaddow.shadowColor = arrowTintShadowColorDarker.colorWithAlphaComponent(0.7 * CGColorGetAlpha(arrowTintShadowColorDarker.CGColor))
        dropShaddow.shadowOffset = CGSize(width: 0.1, height: 0.6)
        dropShaddow.shadowBlurRadius = 1

        if (isUncomputable) {
            //// uncomputableRing Drawing
            CGContextSaveGState(context)
            CGContextTranslateCTM(context, frame.minX + 0.50000 * frame.width, frame.minY + 0.52821 * frame.height)
            CGContextRotateCTM(context, -computeAnimation * CGFloat(M_PI) / 180)

            let uncomputableRingPath = UIBezierPath(ovalInRect: CGRect(x: -54, y: -54, width: 108, height: 108))
            CGContextSaveGState(context)
            CGContextSetShadowWithColor(context, dropShaddow.shadowOffset, dropShaddow.shadowBlurRadius, (dropShaddow.shadowColor as! UIColor).CGColor)
            arrowTintShadowColor.setStroke()
            uncomputableRingPath.lineWidth = 6.5
            CGContextSaveGState(context)
            CGContextSetLineDash(context, -2, [4, 6], 2)
            uncomputableRingPath.stroke()
            CGContextRestoreGState(context)
            CGContextRestoreGState(context)

            CGContextRestoreGState(context)
        }
    }

