    public class func drawListIcon() {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Symbol Drawing
        let symbolRect = CGRect(x: 0, y: 0, width: 22, height: 6)
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)
        CGContextScaleCTM(context, symbolRect.size.width / 44, symbolRect.size.height / 10)

        NSAssetKit.drawListIconSource()
        CGContextRestoreGState(context)


        //// Symbol 2 Drawing
        let symbol2Rect = CGRect(x: 0, y: 8, width: 22, height: 6)
        CGContextSaveGState(context)
        UIRectClip(symbol2Rect)
        CGContextTranslateCTM(context, symbol2Rect.origin.x, symbol2Rect.origin.y)
        CGContextScaleCTM(context, symbol2Rect.size.width / 44, symbol2Rect.size.height / 10)

        NSAssetKit.drawListIconSource()
        CGContextRestoreGState(context)


        //// Symbol 3 Drawing
        let symbol3Rect = CGRect(x: 0, y: 16, width: 22, height: 6)
        CGContextSaveGState(context)
        UIRectClip(symbol3Rect)
        CGContextTranslateCTM(context, symbol3Rect.origin.x, symbol3Rect.origin.y)
        CGContextScaleCTM(context, symbol3Rect.size.width / 44, symbol3Rect.size.height / 10)

        NSAssetKit.drawListIconSource()
        CGContextRestoreGState(context)
    }

