    public class func drawAnimatedAlarm(arrowTintColor arrowTintColor: UIColor = UIColor(red: 1.000, green: 0.067, blue: 0.310, alpha: 1.000), alarmSwing: CGFloat = 0.5, alarmSlientVisible: Bool = false, alarmSnoozeRemaining: String = "--") {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()


        //// Variable Declarations
        let alarmAngle: CGFloat = alarmSwing == 0 ? -10 : floor(10 * alarmSwing)

        //// Bezier 6 Drawing
        let bezier6Path = UIBezierPath()
        bezier6Path.moveToPoint(CGPoint(x: 13.5, y: 2.04))
        bezier6Path.addCurveToPoint(CGPoint(x: 13.5, y: 2.91), controlPoint1: CGPoint(x: 13.5, y: 2.31), controlPoint2: CGPoint(x: 13.5, y: 2.61))
        bezier6Path.addCurveToPoint(CGPoint(x: 17.71, y: 8.1), controlPoint1: CGPoint(x: 15.91, y: 3.73), controlPoint2: CGPoint(x: 17.71, y: 5.69))
        bezier6Path.addCurveToPoint(CGPoint(x: 17.71, y: 13.7), controlPoint1: CGPoint(x: 17.71, y: 11.09), controlPoint2: CGPoint(x: 17.71, y: 12.24))
        bezier6Path.addCurveToPoint(CGPoint(x: 19.5, y: 16.5), controlPoint1: CGPoint(x: 17.71, y: 14.5), controlPoint2: CGPoint(x: 19.5, y: 16.05))
        bezier6Path.addLineToPoint(CGPoint(x: 2.5, y: 16.5))
        bezier6Path.addCurveToPoint(CGPoint(x: 4.29, y: 13.7), controlPoint1: CGPoint(x: 2.5, y: 16.1), controlPoint2: CGPoint(x: 4.29, y: 14.29))
        bezier6Path.addCurveToPoint(CGPoint(x: 4.29, y: 8.1), controlPoint1: CGPoint(x: 4.29, y: 12.18), controlPoint2: CGPoint(x: 4.29, y: 11.28))
        bezier6Path.addCurveToPoint(CGPoint(x: 6.5, y: 3.96), controlPoint1: CGPoint(x: 4.29, y: 6.42), controlPoint2: CGPoint(x: 5.16, y: 4.96))
        bezier6Path.addCurveToPoint(CGPoint(x: 7.74, y: 3.21), controlPoint1: CGPoint(x: 6.88, y: 3.67), controlPoint2: CGPoint(x: 7.3, y: 3.42))
        bezier6Path.addCurveToPoint(CGPoint(x: 8.5, y: 2.91), controlPoint1: CGPoint(x: 7.99, y: 3.1), controlPoint2: CGPoint(x: 8.24, y: 3))
        bezier6Path.addCurveToPoint(CGPoint(x: 8.5, y: 2.04), controlPoint1: CGPoint(x: 8.5, y: 2.61), controlPoint2: CGPoint(x: 8.5, y: 2.31))
        bezier6Path.addCurveToPoint(CGPoint(x: 8.7, y: 1.44), controlPoint1: CGPoint(x: 8.5, y: 1.83), controlPoint2: CGPoint(x: 8.57, y: 1.62))
        bezier6Path.addCurveToPoint(CGPoint(x: 9.32, y: 0.9), controlPoint1: CGPoint(x: 8.84, y: 1.23), controlPoint2: CGPoint(x: 9.06, y: 1.05))
        bezier6Path.addCurveToPoint(CGPoint(x: 11, y: 0.5), controlPoint1: CGPoint(x: 9.78, y: 0.65), controlPoint2: CGPoint(x: 10.37, y: 0.5))
        bezier6Path.addCurveToPoint(CGPoint(x: 13.5, y: 2.04), controlPoint1: CGPoint(x: 12.32, y: 0.5), controlPoint2: CGPoint(x: 13.5, y: 1.16))
        bezier6Path.closePath()
        arrowTintColor.setStroke()
        bezier6Path.lineWidth = 1
        bezier6Path.stroke()


        //// Bezier 3 Drawing
        CGContextSaveGState(context)
        CGContextTranslateCTM(context, 11, 3)
        CGContextRotateCTM(context, -(alarmAngle - 5) * CGFloat(M_PI) / 180)

        let bezier3Path = UIBezierPath()
        bezier3Path.moveToPoint(CGPoint(x: 3.5, y: 16.88))
        bezier3Path.addCurveToPoint(CGPoint(x: 3.5, y: 15.5), controlPoint1: CGPoint(x: 3.5, y: 16.37), controlPoint2: CGPoint(x: 3.5, y: 15.64))
        bezier3Path.addLineToPoint(CGPoint(x: -3.5, y: 15.5))
        bezier3Path.addCurveToPoint(CGPoint(x: -3.5, y: 16.88), controlPoint1: CGPoint(x: -3.5, y: 15.66), controlPoint2: CGPoint(x: -3.5, y: 16.4))
        bezier3Path.addCurveToPoint(CGPoint(x: -2.35, y: 17.34), controlPoint1: CGPoint(x: -3.5, y: 17.07), controlPoint2: CGPoint(x: -3.05, y: 17.23))
        bezier3Path.addCurveToPoint(CGPoint(x: 0, y: 17.5), controlPoint1: CGPoint(x: -1.71, y: 17.44), controlPoint2: CGPoint(x: -0.88, y: 17.5))
        bezier3Path.addCurveToPoint(CGPoint(x: 3.5, y: 16.88), controlPoint1: CGPoint(x: 1.85, y: 17.5), controlPoint2: CGPoint(x: 3.5, y: 17.24))
        bezier3Path.closePath()
        arrowTintColor.setFill()
        bezier3Path.fill()
        arrowTintColor.setStroke()
        bezier3Path.lineWidth = 1
        bezier3Path.stroke()

        CGContextRestoreGState(context)


        if (alarmSlientVisible) {
            //// Bezier 4 Drawing
            let bezier4Path = UIBezierPath()
            bezier4Path.moveToPoint(CGPoint(x: 4.06, y: 2))
            bezier4Path.addLineToPoint(CGPoint(x: 20.56, y: 18.5))
            bezier4Path.addLineToPoint(CGPoint(x: 18.5, y: 20.56))
            bezier4Path.addLineToPoint(CGPoint(x: 2, y: 4.06))
            bezier4Path.addLineToPoint(CGPoint(x: 4.06, y: 2))
            bezier4Path.closePath()
            arrowTintColor.setFill()
            bezier4Path.fill()
        }


        //// Text Drawing
        let textRect = CGRect(x: 0, y: 0, width: 22, height: 22)
        let textStyle = NSMutableParagraphStyle()
        textStyle.alignment = .Center

        let textFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(9), NSForegroundColorAttributeName: arrowTintColor, NSParagraphStyleAttributeName: textStyle]

        let textTextHeight: CGFloat = NSString(string: alarmSnoozeRemaining).boundingRectWithSize(CGSize(width: textRect.width, height: CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: textFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, textRect)
        NSString(string: alarmSnoozeRemaining).drawInRect(CGRect(x: textRect.minX, y: textRect.minY + (textRect.height - textTextHeight) / 2, width: textRect.width, height: textTextHeight), withAttributes: textFontAttributes)
        CGContextRestoreGState(context)
    }

    public class func drawTableViewBackgroundView(backgroundFrame backgroundFrame: CGRect = CGRect(x: 0, y: 0, width: 240, height: 320)) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let logoShadowColor = NSAssetKit.appLogoTintColor.colorWithShadow(0.218)

        //// Gradient Declarations
        let tableBackgroundViewGradient = CGGradientCreateWithColors(CGColorSpaceCreateDeviceRGB(), [NSAssetKit.darkNavColor.CGColor, NSAssetKit.darkNavColor.blendedColorWithFraction(0.5, ofColor: logoShadowColor).CGColor, logoShadowColor.CGColor], [0, 0.51, 1])!

        //// backgroundView Drawing
        let backgroundViewRect = CGRect(x: backgroundFrame.origin.x, y: backgroundFrame.origin.y, width: backgroundFrame.size.width, height: backgroundFrame.size.height)
        let backgroundViewPath = UIBezierPath(rect: backgroundViewRect)
        CGContextSaveGState(context)
        backgroundViewPath.addClip()
        CGContextDrawLinearGradient(context, tableBackgroundViewGradient,
            CGPoint(x: backgroundViewRect.midX, y: backgroundViewRect.minY),
            CGPoint(x: backgroundViewRect.midX, y: backgroundViewRect.maxY),
            CGGradientDrawingOptions())
        CGContextRestoreGState(context)
    }

